import React from 'react';
import './css/HeroHeader.css';

function HeroHeader() {
    return (
        <div class="hero-image">
            <img src={logo} className="App-logo" alt="logo" />
            <div class="hero-text">
                <h1>David Mah</h1>
                <p>Software Engineer</p>
            </div>
        </div> 
    )
}

export default HeroHeader;
